import './Header.css'
// import logo from './img/logo.svg';

const Header = () => {
    return (
        <header className='header'>
            <img src='./icon-left-font.png' className="header-logo" alt="logo" />
            <div className='header-auth'>
                <div className='auth-btn btn-sober' id='login'>Login</div>
                <div className='auth-btn btn-filled' id='signup'>signup</div>
            </div>



        </header>
    )
}

export default Header
